import raw from './assets/sample.txt';

class map
{

      constructor()
      {
            fetch(raw)
            .then(r=>r.text())
            .then(text=>{
                  text.split('\n');
                  text.trim();
                  this.map_width = parseInt(text[4].slice(1,5));
                  console.log(this.map_width);
                  this.map_height = parseInt(text[6]);
            })
            //this.getstuff();
      }

      // getstuff()
      // {
            
      // }

}
 
export default map;
